var title_f38_13_39127="M mode echo aortic root Marfan";
var content_f38_13_39127=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F52118%7ECARD%2F50641&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F52118%7ECARD%2F50641&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    M-mode echocardiogram of aortic regurgitation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 411px; height: 252px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The M-mode echocardiographic findings in aortic regurgitation, due to the Marfan syndrome in this case, include fluttering of the mitral valve (MV) (panel A) and a greatly dilated aortic root (Ao), measuring 48 mm, in relationship to a small appearing left atrium (LA) (panel B), which measures 27 mm. The aortic to atrial diameter ratio has been used as a sign of the Marfan syndrome.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Aortic root enlargement",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 338px; height: 347px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The normal aortic root (RT) and ascending aorta (AAo) are seen in panel A; slight prominence of the sinuses of Valsalva (SinV) can be appreciated. Panel B is the aortic RT and AAo from a patient with the Marfan syndrome; the SinV are large while the AAo is relatively normal, a pattern that seems unique to the Marfan syndrome. In panel C, a greatly enlarged aortic (Ao) RT is also seen, but the pattern differs from that seen in the Marfan patient; the dilatation begins at the aortic ring and continues beyond the sinotubular junction well into the AAo, considered to represent aortoannular ectasia.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
