" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 570px\">",
"   <div class=\"ttl\">",
"    Alendronate dose response in osteoporosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 550px; height: 267px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Mean changes in bone mineral density (measured by dual-energy x-ray absorptiometry) in the lumbar spine and femoral neck in postmenopausal women with osteoporosis treated with placebo or different doses of alendronate for three years. Alendronate caused an increase in bone density, an effect that was most pronounced at a dose of 10 mg/day (red squares). Bone density fell in the placebo group.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Liberman UA, Weiss SR, Broll J, et al. Effect of oral alendronate on bone mineral density and the incidence of fractures in postmenopausal osteoporosis. The Alendronate Phase III Osteoporosis Treatment Study Group. N Engl J Med 1995; 333:1437.",
"    </div>",
